import logo from './logo.svg';
import './App.css';

function App() {
  const now = new Date()
  const a = 2
  const b = 3
  return React.createElement(
    'div',
    null,
    React.createElement(
      'p', null, 'Hola, es ', now.toString()
    ),
    React.createElement(
      'p', null, a, ' Mas ', b, ' is ', a+b
    )
  )
}
ReactDom.render(
  React.createElement(App, null),
  document.getElementById('roots')
)

export default App;
